import React, { useState, useEffect } from "react";
import ReactECharts from "echarts-for-react";

export default function ReactNumberPieChart(props) {
  const DEFAULT_OPTION = {
    series: [
      {
        startAngle: 90,
        endAngle: -270,
        pointer: {
          show: false,
        },
        radius: "85%",
        progress: {
          show: true,
          overlap: false,
          roundCap: true,
          clip: false,
          itemStyle: {
            borderWidth: 0,
            borderColor: "#464646",
          },
        },
        axisLine: {
          lineStyle: {
            show: false,
            width: 20,
          },
        },
        splitLine: {
          show: false,
        },
        axisTick: {
          show: false,
        },
        axisLabel: {
          show: false,
        },
        detail: {
          offsetCenter: [0, 0],
        },
        max: 1,
      },
    ],
  };

  const [option, setOption] = useState(DEFAULT_OPTION);

  return (
    <ReactECharts
      option={option}
      style={{ width: 300, height: 300, minWidth: 300 }}
    />
  );
}
